	}

	#quit_button{
		position: absolute;
		width: 60px;
		height: 40px;

		transition: all 0.25s ease;
	}

		width: 75px;
		height: 46px;
		line-height: 46px;

	.face_down{
		cursor: pointer;
	}
	.face_down:hover{
		-ms-transform: rotate(-1deg);
		-webkit-transform: rotate(-1deg);
		transform: rotate(-1deg);
	}
	.face_down:hover .flipper{
		transform: rotateY(12.25deg);
	}
	.face_down:hover .front{
		box-shadow: -4px 4px 8px rgba(0,0,0,0.5);
		border: solid 1px #888;
		border-radius: 5.555555555556%;
		background-color: #CCC;
	}
	.flipper{
		transition: 0.5s;
		/*transition: 5s;*/
		transform-style: preserve-3d;
		position: relative;
	}
	.front, .back{
		backface-visibility: hidden;
		position: absolute;
		top: 0;
		left: 0;
	}
	.front{
		z-index: 2;
		transform: rotateY(0deg);
		/*transform: rotateY(1deg);*/
	}
	.back{
		transform: rotateY(180deg);
		/*transform: rotateY(181deg);*/
		/*opacity: 0;*/
	}
	.face_up .flipper{
		transform: rotateY(180deg);
	}

	.seen_0{
		-ms-transform: rotate(-3deg);
		-webkit-transform: rotate(-3deg);
		transform: rotate(-3deg);
	}
	.seen_1{
		-ms-transform: rotate(-2deg);
		-webkit-transform: rotate(-2deg);
		transform: rotate(-2deg);
	}
	.seen_2{
		-ms-transform: rotate(-1deg);
		-webkit-transform: rotate(-1deg);
		transform: rotate(-1deg);
	}
	.seen_3{
		-ms-transform: rotate(1deg);
		-webkit-transform: rotate(1deg);
		transform: rotate(1deg);
	}
	.seen_4{
		-ms-transform: rotate(2deg);
		-webkit-transform: rotate(2deg);
		transform: rotate(2deg);
	}
	.seen_5{
		-ms-transform: rotate(3deg);
		-webkit-transform: rotate(3deg);
		transform: rotate(3deg);
	}
	.straightened{
		-ms-transform: rotate(0deg);
		-webkit-transform: rotate(0deg);
		transform: rotate(0deg);
	}

	<script type="text/javascript">

		/*SHARING*/
		var clientURL = document.referrer;

		// if(navigator.userAgent.indexOf('Trident') < 0){
			// clientDomain = new URL(clientURL).hostname;
		// }else{
			clientDomain = (clientURL.substring((clientURL.indexOf('://') + 3),clientURL.length)).substring(0,(clientURL.substring((clientURL.indexOf('://') + 3),clientURL.length)).indexOf('/'));
		// }

		
		// console.log(clientURL)
		// console.log(clientDomain)

		var disableShare = clientURL.toLowerCase().indexOf('hosted.aap.com.au') > 0 && (clientURL.toLowerCase().indexOf('preview.html') > 0 || clientURL.toLowerCase().indexOf('embed.html') > 0);
		/*SHARING*/

		var correct_answer = ['Matched!','Cool!','Correct','Well done','Yeah!','Success','That\'s a pair!','Wow!','Great!','Nice One!','Matching Pair','That\'s right!','Outstanding!','Paired','Brilliant!','Nailed it!','That works','Yes!'];
		var incorrect_answer = ['Nope...','What was that?','That isn\'t right','Not a match.','Really?','Wrong!','That doesn\'t work','FAIL!','Incorrect','Erm... No.','Way off!','Not so good','MISTAKE!','It\'s a MEMORY game, remember?','What were you thinking?','No Way!','You\'re supposed to be MATCHING pairs','They don\'t match.','Too bad...','Unlucky'];
		var repeat_mistake = ['Already tried that','Still not a match','Agian?','Like before... No!','Memory like a sieve!','Still wrong','That STILL doesn\'t work','Goldfish memory','Wrong before,<br>wrong now...'];
		var comment_num = 0;

		// console.log(correct_answer.length)
		// console.log(incorrect_answer.length)
		// console.log(repeat_mistake.length)
		// console.log(Math.max(correct_answer.length,incorrect_answer.length,repeat_mistake.length))
		// console.log(Math.min(correct_answer.length,incorrect_answer.length,repeat_mistake.length))

		var cards = [];
		var explanations = {};
		var flipped = null;

		var unseen = [];
		var remembered = {};
		// var remembered = [];

		var game_mode;
		// var singleplayer = false;
		var turn = 'player_one';
		// var turn = 'computer';
		var difficulty;

		var playing = false;

		var moves_player_one = 0;
		var pairs_player_one = 0;
		var moves_player_two = 0;
		var pairs_player_two = 0;
		var moves_cpu = 0;
		var pairs_cpu = 0;

		var mismatch_player_one = [];
		var mismatch_player_two = [];
		var mismatch_cpu = [];

		var seen_and_missed_player_one = [];
		var seen_and_missed_player_two = [];
		var seen_and_missed_cpu = [];

		var query;
		var game = 'pairs';

		var player_one_errors = {};
		var player_two_errors = {};

		function getQueryParams(qs) {
			qs = qs.split('+').join(' ');

			var params = {},
			tokens,
			re = /[?&]?([^=]+)=([^&]*)/g;

			while (tokens = re.exec(qs)) {
				params[decodeURIComponent(tokens[1])] = decodeURIComponent(tokens[2]);
			}
			return params;
		};

		function toggle_face(card){//console.warn(card + ' ::: ' + playing)
			/*function to swap display property of front/back of cards midway through css flip transition - needed for safari*/
			setTimeout(function(){
				if($('.' + card).hasClass('face_up')){
					$('.' + card + ' .back').removeClass('displayNone');
					$('.' + card + ' .front').addClass('displayNone');
				}else{
					$('.' + card + ' .front').removeClass('displayNone');
					$('.' + card + ' .back').addClass('displayNone');
				}
			},125)
		};

		// function comment(matched,explanation){

		// 	if(matched){
		// 		alert(correct_answer[comment_num] + '\n' + explanation);
		// 	}else{
		// 		alert(incorrect_answer[comment_num]);
		// 	}
			
		// 	comment_num ++;
		// 	if(comment_num > 19){
		// 		comment_num = 0;
		// 	}
		// };

		function recall(){//console.log('recall');
			
			var remembered_keys = Object.keys(remembered);
			// var loop_len = remembered_keys.length;
			var last_key = 0;
			remembered_keys.reverse();

			// console.log(remembered)

			if(difficulty === 'easy'){
				// loop_len = 1;
				last_key = remembered_keys.length - 1;
			}
			
			if(remembered_keys.length > 0){
				for (var i = last_key; i < remembered_keys.length; i++) {
				// for (var i = 0; i < loop_len; i++){
				// for (var i = 0; i < loop_len; i++){
					//Loop through what's been seen so far.
					// console.log(remembered[remembered_keys[i]])
					if(remembered[remembered_keys[i]].length == 2){
						//If cards of matching colour & rank have been seen*/
						if(!flipped){
							// console.log('None flipped, remembered a pair')
							//None have been flipped yet*/
							cpu(remembered[remembered_keys[i]][0]);
						}else{
							// console.log('Remembered the match to the last one')
							//One has been flipped, get the other one.
							var this_colour_rank = $('.first')[0].classList[2];

							if($($('.' + this_colour_rank)[0]).hasClass('first')){
								cpu($('.' + this_colour_rank)[1].className.split(' ')[1])
							}else if($($('.' + this_colour_rank)[1]).hasClass('first')){
								cpu($('.' + this_colour_rank)[0].className.split(' ')[1])
							}
						}
						//Found a pair, break the loop.
						break;
					}

					if(i == (remembered_keys.length - 1)){
						//No pairs are remembered, Choose a card at random which has not yet been flipped.
						if(unseen.length >= 1){
							//If there are still any that have not been seen.
							// console.log('random unseen');console.log(unseen)
							cpu(unseen[Math.floor(Math.random() * unseen.length)]);
						}else{
							//They've all been seen, just pick one of the remaining.
							// console.log('random from remaining')
							cpu($('.face_down')[Math.floor(Math.random()) * $('.face_down').length])
						}
					}
				}
			}else{
				if(unseen.length >= 1){
					//If there are still any that have not been seen.
					// console.warn('random unseen, none remembered')
					cpu(unseen[Math.floor(Math.random() * unseen.length)]);
				}else{
					//They've all been seen, just pick one of the remaining.
					// console.warn('random from remaining, none remembered')
					cpu($('.face_down')[Math.floor(Math.random()) * $('.face_down').length])
				}
			}
		};

		function cpu(pick){//console.warn('\ncpu\n\n');
			// console.log(pick);console.log($('.' + pick));
			$('.' + pick).removeClass('face_down').addClass('face_up');
			toggle_face(pick);
			// alert($('.' + pick))
			memorise($('.' + pick));

			if(!flipped){
				flipped = $('.' + pick).attr('name');
				$('.' + pick).addClass('first');
				setTimeout(recall,500);
			}else{

				$('.' + pick).addClass('second');

				moves_cpu ++;

				if(flipped == $('.' + pick).attr('name')){
					pairs_cpu ++;
					setTimeout(cards_matched,1500);
				}else{
					setTimeout(not_matched,1500);
				}
			}	
		};

		function flip(){//console.log('flip');

			// playing = true;//Move this later
				
			if($(this).hasClass('face_down')){
				$(this).removeClass('face_down').addClass('face_up');
				
				// if(difficulty === 'difficult'){
					memorise($(this));
				// }
				
				// console.log(this);
				toggle_face(this.id);


				if(!flipped){
					//The first turned over.
					flipped = $(this).attr('name');//Colour & rank.
					$(this).addClass('first');
				}else{
					//The second turned over.
					$('.card').unbind();
					$(this).addClass('second');

					$('#overlay').removeClass('displayNone');

					// console.warn(turn);
					
					if(turn == 'player_one'){
						moves_player_one ++;
					}

					if(turn == 'player_two'){
						moves_player_two ++;
					}

					if(flipped == $(this).attr('name')){//Colour & rank match.
						
						if(turn == 'player_one'){
							pairs_player_one ++;
						}

						if(turn == 'player_two'){
							pairs_player_two ++;
						}
						
						setTimeout(cards_matched,1500);
					}else{//Not a match.
						setTimeout(not_matched,1500);

						// console.warn(flipped + ' != ' + $(this).attr('name'))
						// console.warn($('.first').attr('id') + ' != ' + this.id)

						// if(turn == 'player_one'){
						// 	// player_one_errors[$('.first').attr('id') + '_' + this.id] = [$('.first').attr('id'),this.id];
						// 	player_one_errors[$('.first').attr('id') + '_' + this.id] = false;
						// 	player_one_errors[this.id + '_' + $('.first').attr('id')] = false;
						// }else if(turn == 'player_two'){
						// 	player_two_errors[$('.first').attr('id') + '_' + this.id] = [$('.first').attr('id'),this.id];
						// }
					}

					// _gaq.push(['_trackEvent', (clientDomain + ' ' + game), 'Flipped Cards',turn,, false]);
					// ga('send','event',(clientDomain + ' ' + game),'Flipped Cards',turn);
					// console.log('send', 'event',(clientDomain + ' ' + game),'Flipped Cards',turn);
				}
			}

			// toggle_face($(this));
		};

		function memorise(card){
			// console.log('memorise');
			// console.log(card[0].id);
			// $('#' + card[0].id + ' .flipper .front').html(card[0].id)
			
			//ADDING 'SEEN' TO MEMORY
			// $('.' + card[0].classList[1] + ' .front').css({'background-color':'#0F0'})
			var seen = card[0].classList;//["card",rank_suit,colour_rank,colour,"position_i","face_up/face_down","first/second"]
			// console.log(seen)
			//Remove this specific card from the 'unseen' list,` as it has now been seen.
			for(var i = 0; i < unseen.length; i ++){
				if(seen[1] == unseen[i]){
					unseen.splice(i,1);
				}
			}
			//If the colour & rank has not yet been seen, add it with this card.
			if(!remembered[seen[2]]){
				remembered[seen[2]] = [seen[1]];
			}else{
				//If this matches colour & rank of one that's been seen, put them together.
				if(remembered[seen[2]][1] != seen[1]){
					remembered[seen[2]][1] = seen[1];
				}
			}

		function new_move(){//console.log('new_move');

			$('.pos_20').remove();//Clear unused.

			if($('.card').length > 0){

				$('#wrapper').removeClass('overflowHidden');

				if(game_mode === 'playcpu' && turn === 'computer'){
					setTimeout(recall,1500);
				}else{
					$('.card').click(flip);
				}
			}else{

				var final_result;

				if(game_mode == 'singleplayer'){
					final_result = 'Results';
					$('#result_inner p').html('Moves: ' + moves_player_one + ',<br>Pairs: ' + pairs_player_one + '<br>Accuracy: ' + Math.round((pairs_player_one / moves_player_one) * 100) + '%<br>');
				}else if(game_mode == 'twoplayer'){
					if(Math.round((pairs_player_one / moves_player_one) * 100) > Math.round((pairs_player_two / moves_player_two) * 100)){
						final_result = 'Player One Wins!';
					}else if(Math.round((pairs_player_one / moves_player_one) * 100) < Math.round((pairs_player_two / moves_player_two) * 100)){
						final_result = 'Player Two Wins!';
					}else{
						final_result = 'It\'s a tie!';
					}
					$('#result_inner p').html('<strong>Player One</strong><br>Moves: ' + moves_player_one + ',&nbsp;Pairs: ' + pairs_player_one + '<br>Accuracy: ' + Math.round((pairs_player_one / moves_player_one) * 100) + '%<br><br><strong>Player Two</strong><br>Moves: ' + moves_player_two + ',&nbsp;Pairs: ' + pairs_player_two + '<br>Accuracy: ' + Math.round((pairs_player_two / moves_player_two) * 100) + '%');
				}else if(game_mode == 'playcpu'){
					if(Math.round((pairs_player_one / moves_player_one) * 100) > Math.round((pairs_cpu / moves_cpu) * 100)){
						final_result = 'You Win!';
					}else if(Math.round((pairs_player_one / moves_player_one) * 100) < Math.round((pairs_cpu / moves_cpu) * 100)){
						final_result = 'Computer Wins!';
					}else{
						final_result = 'It\'s a draw!';
					}
					$('#result_inner p').html('<strong>You</strong><br>Moves: ' + moves_player_one + ',&nbsp;Pairs: ' + pairs_player_one + '<br>Accuracy: ' + Math.round((pairs_player_one / moves_player_one) * 100) + '%<br><br><strong>Computer</strong><br>Moves: ' + moves_cpu + ',&nbsp;Pairs: ' + pairs_cpu + '<br>Accuracy: ' + Math.round((pairs_cpu / moves_cpu) * 100) + '%');
				}

				$('#result .small_banner').html(final_result);

				ga('send','event',(clientDomain + ' ' + game),'Finished Game',final_result);

		function reset_game(something){
			// console.log(something)
			playing = false;
			
			$('#wrapper').addClass('overflowHidden');
			$('.difficulty, #back, #quit_button').addClass('displayNone');
			$('.game_mode').removeClass('displayNone opacityZero');
			$('.status_panel').html('');

				$('#result').addClass('displayNone opacityZero');
				$('#overlay').removeClass('displayNone opacityZero');
			}

			if(something == 'finished'){
				$('#overlay').addClass('opacityZero');
				$('#result').removeClass('displayNone opacityZero');

				setTimeout(shuffle,1000);
			}
		};

		function rolling_demo(n){//console.log('rolling_demo')
			if(!playing){
				
				$('.' + cards[n][1]).removeClass('face_down').addClass('face_up');
				// console.warn('flip ' + cards[n][1] + ' to face up. Specific colour and rank')
				toggle_face(cards[n][1])
				
				setTimeout(function(){//flip back to face down
					$('.' + cards[n][1]).removeClass('face_up').addClass('face_down');
					// toggle_face(cards[n][1],'face_up')
					// console.log('flip ' + cards[n][1] + ' to face down. Specific colour and rank.')
					toggle_face(cards[n][1])
				},1375)
				setTimeout(function(){
					$('.' + cards[n][0]).removeClass('face_down').addClass('face_up');
					// toggle_face(cards[n][0],'face_down')
					// console.warn('flip ' + cards[n][0] + ' to face up. Matching colour and rank.\n\n')
					toggle_face(cards[n][0])
				},500)
				setTimeout(function(){
					$('.card').removeClass('face_up').addClass('face_down');
					// console.log('flip ALL CARDS to face down\n\n')
					toggle_face('card')
				},1500)
				setTimeout(function(){
					
					n++;
					
					if((n + 1) < cards.length && cards[(n + 1)][0] == cards[n][0]){
						n++;
					}

					if(n >= cards.length){
						n = 0;
					}

					rolling_demo(n)
				},2500)
			}
		};

		function load_game(game){
			$.getJSON('script/' + game + '.js',function(data){

				// $('#board').addClass('x' + Object.keys(data).length * 2);
				$('#wrapper').addClass('x' + Object.keys(data).length * 2);
				for(var i = 0; i < Object.keys(data).length; i ++){

					cards.push(
						[
							Object.keys(data)[i],
							Object.keys(data[Object.keys(data)[i]])[0],
							data[Object.keys(data)[i]][Object.keys(data[Object.keys(data)[i]])[0]].banner,
							data[Object.keys(data)[i]][Object.keys(data[Object.keys(data)[i]])[0]].image
						],
						[
							Object.keys(data)[i],
							Object.keys(data[Object.keys(data)[i]])[1],
							data[Object.keys(data)[i]][Object.keys(data[Object.keys(data)[i]])[1]].banner,
							data[Object.keys(data)[i]][Object.keys(data[Object.keys(data)[i]])[1]].image
						]
					);
					
					explanations[Object.keys(data)[i]] = data[Object.keys(data)[i]].Explain;
				}
			})
			.done(shuffle);
		};

		function message(message,num){
			// console.log(num)
			var this_msg = 'msg_' + new Date().getTime();

			// $('.messages'[num]).append('<div class="message message_hidden" id="' + this_msg + '">' + message + '</div>');
			$($('.messages')[num]).html('<div class="message message_hidden" id="' + this_msg + '">' + message + '</div>');

			setTimeout(function(){
				message_reveal(this_msg,num);
			},125)
		};

		function message_reveal(this_msg,num){
			// console.warn((Math.ceil(($('#' + this_msg).html().split(' ').length / 3) + 1) * 1000))
			$('#' + this_msg).removeClass('message_hidden');
			setTimeout(function(){
				message_conceal(this_msg,num);
			},(Math.ceil(($('#' + this_msg).html().split(' ').length / 3) + 0) * 1000));
			// },1500);
		};

			// 	console.log(num)
			// 	// $($('.messages')[0] + ' .message').remove();
			// 	$($('.message')[0]).remove();

			// 	return false;
			// }

			$('#' + this_msg).addClass('message_out');
			setTimeout(function(){
				message_remove(this_msg);
			},250);
		};

		function message_remove(this_msg){
			$('#' + this_msg).remove();
		};

				// $('#base_bg').attr('src','images/pics/' + game + '/base.svg');
			}else{

				$('#overlay').css({
					backgroundImage:'url(images/pics/' + game + '/banner.png)'
				});

				$('#result').css({
					backgroundImage:'url(images/pics/' + game + '/result_bg.png)'
				});

				$('.options_button').css({
					backgroundImage:'url(images/pics/' + game + '/button.png)'
				});

				$('.small_banner').css({
					backgroundImage:'url(images/pics/' + game + '/small_banner.png)'
				});

				// $('#base_bg').attr('src','images/pics/' + game + '/base.png');
				$('#base_bg').append(`<img src="images/pics/${game}/base.png">`);
			}

			/*HOVER STATES TOUCH*/
			var isTouch = false //var to indicate current input type (is touch versus no touch) 
			var isTouchTimer 
			var curRootClass = '' //var indicating current document root class ("can-touch" or "")
			
			function addtouchclass(e){
				clearTimeout(isTouchTimer)
				isTouch = true
				if (curRootClass != 'can-touch'){ //add "can-touch' class if it's not already present
					curRootClass = 'can-touch'
					document.documentElement.classList.add(curRootClass)
				}
				isTouchTimer = setTimeout(function(){isTouch = false}, 500) //maintain "istouch" state for 500ms so removetouchclass doesn't get fired immediately following a touch event
			}
			
			function removetouchclass(e){
				if (!isTouch && curRootClass == 'can-touch'){ //remove 'can-touch' class if not triggered by a touch event and class is present
					isTouch = false
					curRootClass = ''
					document.documentElement.classList.remove('can-touch')
				}
			}
			
			document.addEventListener('touchstart', addtouchclass, false) //this event only gets called when input type is touch
			document.addEventListener('mouseover', removetouchclass, false) //this event gets called when input type is everything from touch to mouse/ trackpad
			/*HOVER STATES TOUCH*/
			

			load_game(game);
		});
	</script>
</body>
</html>
